def _try_convert_to_date(self, data):
    """
    Try to parse a ndarray like into a date column.

    Try to coerce object in epoch/iso formats and integer/float in epoch
    formats. Return a boolean if parsing was successful.
    """
    if not len(data):
        return data, False

    new_data = data
    if new_data.dtype == "object":
        try:
            new_data = data.astype("int64")
        except (TypeError, ValueError, OverflowError):
            pass
        except AttributeError:  # handle RangeIndex
            new_data = data.values.astype("int64")

    if isinstance(new_data, np.ndarray) and np.issubdtype(new_data.dtype, np.number):
        in_range = (
            isna(new_data) | (new_data > self.min_stamp) | (new_data == iNaT)
        )
        if not in_range.all():
            return data, False

    if isinstance(new_data, (pd.Series, pd.RangeIndex)):
        new_data = pd.to_numeric(new_data, errors="coerce")

    return new_data, True
